import axios from "axios";

export const productAPI = {
  getDataProduct: async () => {
    try {
      const response = axios.get(
        "https://652a1c1155b137ddc83f4d53.mockapi.io/product"
      );
      return response;
    } catch (error) {
      console.log(error);
    }
  },
};
